            while (sc.hasNext()) {
                inline += sc.nextLine();
            }
            sc.close();

            JsonElement jelement = new JsonParser().parse(inline);
            JsonObject jobject = jelement.getAsJsonObject();
            jobject = jobject.getAsJsonObject("main");

            double temp = Math.round((jobject.get("temp").getAsDouble() - 273.15) * 10.0) / 10.0;
