        // Calculate total score by summing up individual scores
        int totalScore = 0;
        for (String key : properties.keySet()) {
            totalScore += calcScore(key, properties);
        }

        // Print results
        System.out.println("\nOverall Cleaning Level:");
        if (totalScore > 18) {
